const App = () => {
  const [items, setItems] = useState([]);
  const [page, setPage] = useState(1);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    if (loading) return;
    if (items.length >= 100) return;
    setLoading(true);
    fetch(`https://my-api.com/items?page=${page}`)
      .then((res) => res.json())
      .then((data) => {
        setItems([...items, ...data]);
        setPage(page + 1);
        setLoading(false);
      });
  }, [loading, page, items]);

  return (
    <div className="App" style={{ overflowY: "scroll" , maxHeight:'400px'}}>
      {data.slice(page * 10, page * 10 + 10).map((ele, idx) => (
        <div
          style={{ border: "1px solid black" }}
          key={idx + idx}
          onScroll={handleScroll}
        >
          <h3>{ele.name}</h3>
          <h4>{ele.city}</h4>
          <h5>{ele.pincode}</h5>
          <h5>{ele.country}</h5>
        </div>
      ))}
      {/* <h1>more</h1> */}
    </div>
  );
};

export default App;
